import Nav from './Nav'
import {useParams} from 'react-router-dom'
import { useEffect, useState } from 'react';


export default function Study(){
    const params = useParams();
    const [deck, setDeck] = useState({});

    useEffect(() => {
        async function loadDeck(){
            const response = await fetch(`http://localhost:5000/decks/${params.deckId}`)
            const deckFromAPI = await response.json();
            setDeck(deckFromAPI);
        }
        loadDeck();
    }, [params.deckId]);
console.log(deck);
    return (
        <div>
            <Nav/>
            <h1>{deck.name}</h1>
        </div>
    )

}
